import React, { Component } from "react";

class Input extends Component {
  render() {
    return (
      <div className="InputBox">
        <div className="Input">
          <GroupedSelect />
        </div>
        <div className="Input">
          <SingleSelect />
        </div>
      </div>
    );
  }
}

export default Input;
